import React from 'react'
import PropTypes from 'prop-types'

const GifItem = ({ title, url, id }) => {

  return (
    <div className='card'>
      <img src={ url.url } alt={title} />
      <p>{ title }</p>
    </div>
  )
}

GifItem.prototype = {
  title: PropTypes.string.isRequired,
  url: PropTypes.string.isRequired,
}

export default GifItem
